import React from 'react';
import {
  Switch,
  Route,
} from "react-router-dom";
import Header from './layouts/header';
import ListAccounts from './accounts';

function MainAdmin(props) {
  return (
    <div>
     <Header/>
      <Switch>
        <Route exact path="/admin">
          <ListAccounts/>
        </Route>
      </Switch>
    </div>
  )
}

export default MainAdmin;
